INSERT INTO `wisata` (`id_wisata`, `nama`, `alamat`, `lat`, `long`, `lokasi`, `foto`, `deskripsi`, `id_category`, `created_at`, `updated_at`) VALUES
(54, 'Dinas Kebudayaan dan Pariwisata', '', 3.6131063173695077, 98.71654496445313, 'Other', 'none.jpg', '', 9, '2022-12-14 01:05:58', '2022-12-14 01:05:58'),
(3, 'Museum Negeri Sumatera Utara', 'Jl, HM, Joni No,51, Teladan Bar,, Kec, Medan Kota, Kota Medan, Sumatera Utara 20217', 3.5683723046782783, 98.69632408437656, 'Other', 'Museum_Negeri_Sumatera_Utara-2022-12-23-.jpg', 'Museum Sumatra Utara atau yang lebih dikenal warga Sumut Museum Negeri Provinsi Sumatra Utara (disingkat Museum Negeri Provsu) ini terletak di Jln. H.M. Jhoni No. 51 Medan. Merupakan Museum terbesar di Sumatra Utara yang berbagai peninggalan sejarah ', 7, '2022-11-13 22:55:05', '2022-12-23 05:28:29'),
(2, 'Museum Pusaka Nias', 'Jl, Yos Sudarso No,134-A, Iraonogeba, Gn, Sitoli, Kota Gunungsitoli, Sumatera Utara 22812', 1.2986320066639805, 97.60878124759289, 'Nias', 'Museum_Pusaka_Nias-2022-12-23-.jpg', 'Museum Pusaka Nias adalah sebuah museum di Gunungsitoli yang didirikan untuk melestarikan budaya Nias. Museum ini dikelola oleh Yayasan Pusaka Nias yang bersifat sosial dan nirlaba. Kegiatan utamanya berfokus pada pelestarian budaya Nias. Yayasan Pus', 7, '2022-11-13 22:53:48', '2022-12-23 05:27:46'),
(51, 'Pelabuhan Laut Pulau Nias', '', 1.183948616682992, 97.68593776754622, 'Nias', 'none.jpg', '', 9, '2022-12-14 02:08:36', '2022-12-14 02:08:36'),
(1, 'Museum Situs Kota Cina', 'Jl, Kota Cina, Paya Pasir, Kec, Medan Marelan, Kota Medan, Sumatera Utara 20254', 3.723013616262166, 98.65675411646754, 'Other', 'Museum_Situs_Kota_Cina-2022-12-23-.jpg', 'Museum Situs Kota China merupakan nama sebuah situs arkeologi yang terletak di tepi danau Siombak, Kelurahan Paya Pasir, Kecamatan Medan Marelan, Kota Medan. Situs Kota China di Medan Marelan telah diketahui sejak tahun 1970-an, namun jejak sejarahny', 7, '2022-11-13 22:53:48', '2022-12-23 05:26:49'),
(4, 'Museum TB Silalahi', 'Jl, Dr, TB, Silalahi No,88, Silalahi Pagar Batu, Balige, Toba, Sumatera Utara', 2.333222398648192, 99.0484150813291, 'Other', 'Museum_TB_Silalahi-2022-12-22-.jpg', 'Museum TB. Silalahi atau yang diberi nama Museum Jejak Langkah dan Sejarah TB. Silalahi yang dibangun sebagai wadah untuk memotivasi generasi muda untuk terus meraih cita-cita dengan melihat pengalaman TB. Silalahi mulai dari kecil sebagai anak penge', 7, '2022-11-26 18:39:43', '2022-12-22 01:36:34'),
(5, 'Museum Daerah Kabupaten Langkat', 'Jalan Amir Hamzah Nomor 1, Kabupaten Langkat, Provinsi Sumatera Utara', 3.8924770971245577, 98.42571095756344, 'Other', 'Museum_Daerah_Kabupaten_Langkat-2022-12-22-.jpg', 'Museum daerah Kabupaten Langkat terletak di kota Tanjung Pura. Keberadaan Museum Daerah ini dirintis pada tahun 2003 dengan memanfaatkan gedung bekas Kerajaan Sultan Langkat yang didirikan pada tahun 1905. Museum ini terletak di Jl. T. Amir Hamzah da', 7, '2022-11-26 18:39:43', '2022-12-22 01:36:47'),
(6, 'Museum Perjuangan TNI', 'Jalan Zainul Arifin no,8 Kelurahan Petisah Tengah, Kecamatan Petisah, Kota, Provinsi Sumatra Utara', 3.5837659960350177, 98.6741670228208, 'Other', 'Museum_Perjuangan_TNI-2022-12-22-.jpg', 'Bangunan Museum Perjuangan TNI Kodam I Bukit Barisan ini memiliki sejarah yang cukup panjang hingga menjadi Museum. Didirikan pada tahun 1928, bangunan ini awalnya digunakan sebagai bangunan Asuransi NV. Levensverzekering Mattschappiy \"Arhnehen\". Pad', 7, '2022-11-26 18:47:02', '2022-12-22 01:37:08'),
(7, 'Museum Simalungun', 'Jalan Sudirman Nomor 20, Kelurahan Proklamasi, Kecamatan Siantar Barat, Kota Pematangsiantar, Provinsi Sumatera Utara', 2.954376245030513, 99.06104455121105, 'Other', 'Museum_Simalungun-2022-12-22-.jpg', 'Museum ini mulai dibangun pada bulan April tahun 1939 dan selesai dibangun pada bulan Desember pada tahun yang sama. Pembangunan museum bertujuan untuk melestarikan budaya Batak Simalungun seperti benda-benda cagar budaya yang bernilai sejarah. Museu', 7, '2022-11-26 18:47:02', '2022-12-22 01:37:23'),
