(48, 'Istana Lima Laras', 'Dsn Iii Desa Lima Laras, Kel, Lima Laras, Kec, Nibung Hangus, Kab, Batu Bara, Lima Laras, Kec Tanjung Tiram, Kabupaten Batu Bara, Sumatera Utara', 3.181497819926307, 99.6187436316868, 'Other', 'Istana_Lima_Laras-2022-12-22-.jpg', 'Istana lima laras merupakan bangunan tempat tinggal penguasa sekaligus pusat kekuasaan politik, sosial dan ekonomi ini dibangun oleh Datuk Muhammad Yuda. Beliau yang bertahta pada tahun 1883 hingga 1919 adalah raja yang kesebelas dari kerajaan Lima L', 5, '2022-11-26 21:43:35', '2022-12-22 01:56:24'),
(49, 'Istana Kerajaan Bedagai', 'Tanjung Beringin, Pekan Tanjung Beringin, Kec Tanjung Beringin, Kabupaten Serdang Bedagai, Sumatera Utara', 3.4925154583864844, 99.19551226093702, 'Other', 'Istana_Kerajaan_Bedagai-2022-12-22-.png', 'Kerajaan Bedagai merupakan salah satu kerajaan yang pernah berdiri di Serdang Bedagai. Wilayahnya meliputi Kecamatan Tanjung Beringin, Sei Rampah, Teluk Mengkudu dan Dolok Masihul. Kerajaan Bedagai berawal dari hubungan pernikahan antara Sultan Osman', 5, '2022-11-26 21:43:35', '2022-12-22 01:56:43'),
(50, 'Istana Sultan Basyaruddin', 'Jl, Rantau Panjang, Rantau Panjang, Kec Pantai Labu, Kabupaten Deli Serdang, Sumatera Utara', 3.68221273814661, 98.84275007203031, 'Other', 'Istana_Sultan_Basyaruddin-2022-12-22-.jpg', 'Istana sultan basyaruddin dibangun sekitar tahun 1800-an. Istana tersebut dipergunakan sebagai tempat tinggal Sultan Basyaruddin. Sultan Basyaruddin Shariful Alamsyah merupakan sultan serdang ke IV. Istana ini juga dijadikan tempat pertahanan dari se', 5, '2022-11-26 21:43:35', '2022-12-22 01:56:55');
